import { itemsa } from './itemsa';
export class changestock extends React.Component {
    constructor(){
        super();
        this.ReloadData=this.ReloadData.bind(this);
    }
    state = {
        itemsa: []

    };
    componentDidMount() {
        axios.get('http://localhost:4000/api/items')
            .then(
                (response) => {
                    this.setState({ itemsa: response.data})
                })
            .catch(
                (error) => { console.log(error) }
            )

    }
    render() {
        return (
            <div>
                <h1>This is the read Component</h1>
                <Itemsget movies={this.state.Itemsget} ReloadData={this.ReloadData}></Itemsget>

            </div>
          
        );
    }
    ReloadData(){//Reloads data
        axios.get('http://localhost:4000/api/items')//Pulls from server
        .then(
            (response) => {
                this.setState({ items: response.data})
            })
        .catch(
            (error) => { console.log(error) }
        )
    }
}
